window.bookSummaryJSON = "This stunning blend of historical romance and time traveling adventure has captured the hearts of millions of readers around the world and catapulted author Diana Gabaldon to the top of the <i>New York Times</i> best seller list. <i>Outlander</i> introduces an exhilarating world of heroism and breathtaking thrills as one woman is torn between past and present, passion and love. <p>In 1945, former combat nurse Claire Randall returns from World War II and joins her husband for a second honeymoon. Their blissful reunion is shattered when she touches a boulder in an ancient stone ruin and is instantly transported to 1743 Scotland, a place torn by war and raiding border clans. Will Claire find her way back to her own time, or is her destiny forever linked with Clan MacKenzie and the gallant James Fraser?</p>"; 
